import React ,{useState}from "react";



const Home = () => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);

  const handleDropdownToggle = () => {
    setDropdownOpen(!isDropdownOpen);
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    window.location.reload();
  };

  return (
    <>
      <div class="max-w-2xl mx-auto">
        <nav class="border-gray-200">
          <div class="container mx-auto flex flex-wrap items-center justify-between">
            <a href="#" class="flex">
              <svg
                class="h-10 mr-3"
                width="51"
                height="70"
                viewBox="0 0 51 70"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                {/* SVG Path */}
              </svg>
              <span class="self-center text-lg font-semibold whitespace-nowrap">
                FlowBite
              </span>
            </a>
            <button
              data-collapse-toggle="mobile-menu"
              type="button"
              class="md:hidden ml-3 text-gray-400 hover:text-gray-900 focus:outline-none focus:ring-2 focus:ring-blue-300 rounded-lg inline-flex items-center justify-center"
              aria-controls="mobile-menu-2"
              aria-expanded="false"
            >
              {/* Mobile Menu Icon */}
            </button>
            <div
              class="hidden md:block w-full md:w-auto"
              id="mobile-menu"
            >
              <ul class="flex-col md:flex-row flex md:space-x-8 mt-4 md:mt-0 md:text-sm md:font-medium">
                <li>
                  <a
                    href="#"
                    class="bg-blue-700 md:bg-transparent text-white block pl-3 pr-4 py-2 md:text-blue-700 md:p-0 rounded focus:outline-none"
                    aria-current="page"
                  >
                    Home
                  </a>
                </li>
                <li>
                  <button
                    id="dropdownNavbarLink"
                    onClick={handleDropdownToggle}
                    data-dropdown-toggle="dropdownNavbar"
                    class="text-gray-700 hover:bg-gray-50 border-b border-gray-100 md:hover:bg-transparent md:border-0 pl-3 pr-4 py-2 md:hover:text-blue-700 md:p-0 font-medium flex items-center justify-between w-full md:w-auto"
                  >
                    Dropdown{" "}
                    <svg
                      class="w-4 h-4 ml-1"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                      xmlns="http://www.w3.org/2000/svg"
                    >
                      {/* SVG Path */}
                    </svg>
                  </button>
                  {/* <!-- Dropdown menu --> */}
                  <div
                    id="dropdownNavbar"
                    class={`${
                      isDropdownOpen ? "block" : "hidden"
                    } bg-white text-base z-10 list-none divide-y divide-gray-100 rounded shadow my-4 w-44`}
                  >
                    <ul
                      class="py-1"
                      aria-labelledby="dropdownNavbarLink"
                    >
                      <li>
                        <a
                          href="#"
                          class="text-sm hover:bg-gray-100 text-gray-700 block px-4 py-2"
                        >
                          Dashboard
                        </a>
                      </li>
                      <li>
                        <a
                          href="#"
                          class="text-sm hover:bg-gray-100 text-gray-700 block px-4 py-2"
                        >
                          Settings
                        </a>
                      </li>
                      <li>
                        <a
                          href="#"
                          class="text-sm hover:bg-gray-100 text-gray-700 block px-4 py-2"
                        >
                          Earnings
                        </a>
                      </li>
                    </ul>
                    <div class="py-1">
                      <a
                        href="#"
                        class="text-sm hover:bg-gray-100 text-gray-700 block px-4 py-2"
                      >
                        Sign out
                      </a>
                    </div>
                  </div>
                </li>
                <li>
                  <a
                    href="#"
                    class="text-gray-700 hover:bg-gray-50 border-b border-gray-100 md:hover:bg-transparent md:border-0 block pl-3 pr-4 py-2 md:hover:text-blue-700 md:p-0"
                  >
                    Services
                  </a>
                </li>
                <li>
                  <a
                    href="#"
                    class="text-gray-700 hover:bg-gray-50 border-b border-gray-100 md:hover:bg-transparent md:border-0 block pl-3 pr-4 py-2 md:hover:text-blue-700 md:p-0"
                  >
                    Pricing
                  </a>
                </li>
                <li>
                  <a
                    href="#"
                    class="text-gray-700 hover:bg-gray-50 border-b border-gray-100 md:hover:bg-transparent md:border-0 block pl-3 pr-4 py-2 md:hover:text-blue-700 md:p-0"
                  >
                    Contact
                  </a>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        <p class="mt-5">
          This dropdown navbar element is part of a larger, open-source library
          of Tailwind CSS components. Learn more by going to the official{" "}
          <a
            class="text-blue-600 hover:underline"
            href="#"
            target="_blank"
          >
            Flowbite Documentation
          </a>
          .
        </p>
      </div>
    </>
  );
};

export default Home;

